import React from 'react';

function CartItem(props){
    return(
        <div>
            <h2 className = "cartItemTitle">{props.title}</h2>
            <button>-</button>
            <input type="number" placeholder = "0" id={props.name} className = "quantity" min="1"></input>
            <button>+</button>
            <h2>{props.price}</h2>
        </div>
    );
}

export default CartItem;
